import React from 'react'
import Form from './Form'
function Contact() {
    const flex = {
        display: 'flex',
        flexWrap: 'wrap'

    }
    const hari = {
        color: 'black',
        marginTop: '200px',
        fontSize: '40px',
        display:'block'
    }
    return (
        <>

            <main style={flex}>
                <div id='form' style={{ display: 'none', marginTop: '100px' }} >
                    <Form /></div>
                <div style={hari}>
                    <a href='https://www.facebook.com/programmer.me1' style={{textDecoration:'none',color:'black'}}>
                    <i className='fa fa-facebook-square'></i></a><br/>
                    <a href='https://www.facebook.com/programmer.me1' style={{textDecoration:'none',color:'black'}}> <i className='fa fa-twitter-square'></i><br/>
                    <i className='fa fa-reddit-square'></i></a><br/>
                    <i className='fa fa-instagram'></i><br/>
                    <i className='fa fa-google'></i><br/>
                    <i className='fa fa-linkedin-square'></i>
                </div>
            </main>
        </>
    );
}
export default Contact;
